import React from 'react';
import { useState } from 'react';
import './Projects.css';

function Projects() {
  const [projects] = useState([
    {
      title: 'School Management System',
      img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTILAj21BEKI5nYYpmEXlM9tjTK16ezTTueSw&usqp=CAU',
      gLink: 'https://github.com/Muhammad-Sooman',
      lLink: 'https://github.com/Muhammad-Sooman',
    },
    {
      title: 'Covid App',
      img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQSSXlL4F_wMjCv9GNsOBC0Z1r122V3EEVfuw&usqp=CAU',
      gLink: 'https://github.com/Muhammad-Sooman',
      lLink: 'https://github.com/Muhammad-Sooman',
    },
    {
      title: 'Wallpaper App',
      img: 'data:image/jpeg;base64,',
      gLink: 'https://github.com/Muhammad-Sooman',
      lLink: 'https://github.com/Muhammad-Sooman',
    },
    {
      title: 'Arabic App',
      img: 'data:image/jpeg;base64,',
      gLink: 'https://github.com/Muhammad-Sooman',
      lLink: 'https://github.com/Muhammad-Sooman',
    },
    {
      title: 'Book Kingdom',
      img: 'data:image/png;base64,',
      gLink: 'https://github.com/Muhammad-Sooman',
      lLink: 'https://github.com/Muhammad-Sooman',
    },
    {
      title: 'Bizcol',
      img: '/projects/6.png',
      gLink: 'https://github.com/Muhammad-Sooman',
      lLink: 'https://github.com/Muhammad-Sooman',
    },
  ]);
  return (
    <section className='projects' id='projects'>
      <div className='container'>
        <div className='title'>
          <h3>Featured Projects</h3>
          <a
            href='https://github.com/Muhammad-Sooman'
            target='_blank'
            className='btn'
            rel='noreferrer'
          >
            View All
          </a>
        </div>
        <div className='projects-wrapper'>
          {projects.map((project, i) => (
            <div className='project' key={i}>
              <div className='img-container'>
                <img src={project.img} alt={project.title} />
              </div>
              <div className='description'>
                <h4>{project.title}</h4>
                <div className='links'>
                  <a href={project.gLink} target='_blank' rel='noreferrer'>
                    <i className='fab fa-github'></i>
                  </a>
                  <a href={project.lLink} target='_blank' rel='noreferrer'>
                    <i className='fa fa-globe'></i>
                  </a>
                </div>
              </div>
              <p>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Laborum
                ea nobis aut deserunt. Reprehenderit numquam harum facilis
                beatae praesentium pariatur eligendi non. Explicabo, cupiditate
                odit vero quo iste numquam obcaecati.
              </p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}

export default Projects;
